import React from 'react';
import { Button, Navbar, Nav, NavDropdown, Form, FormControl, NavItem, Dropdown} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

class NavBar3 extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return (




<Navbar>
<Navbar.Header>
  <Navbar.Brand>
	<a href="#">EIS</a>
  </Navbar.Brand>
  <Navbar.Toggle />
</Navbar.Header>
<Navbar.Collapse>
<Nav>
  <NavItem eventKey={1} href="#">Home</NavItem>
  <NavItem eventKey={2} href="#">Edit Profile</NavItem>
  <NavDropdown eventKey={3} title="Help Desk" id="basic-nav-dropdown">
	<Dropdown.Item eventKey={3.1}>View Tickets</Dropdown.Item>
	<Dropdown.Item eventKey={3.2}>New Ticket</Dropdown.Item>
  </NavDropdown>
</Nav>
</Navbar.Collapse>
</Navbar>


)
}
}

export default NavBar3
